pragma solidity ^0.5.8;

import './PostMapping.sol';
import './Utils.sol';


contract DPostit {event __CoverageDPostit(string fileName, uint256 lineNumber);
event __FunctionCoverageDPostit(string fileName, uint256 fnId);
event __StatementCoverageDPostit(string fileName, uint256 statementId);
event __BranchCoverageDPostit(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageDPostit(string fileName, uint256 branchId);
event __AssertPostCoverageDPostit(string fileName, uint256 branchId);

    constructor() public {emit __FunctionCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',1);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',9);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',1);
contractOwner = msg.sender;
    }

    address private contractOwner;
    uint private minGoal = 1000 wei;
    mapping(address => mapping(uint => bool)) validAddressesWhenPay;

    event ReturnPostFileUrl(string);

    PostMapping.Post post;
    modifier isContractOwner() {emit __FunctionCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',2);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',20);
        emit __AssertPreCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',1);
emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',2);
require(msg.sender == contractOwner, "You are not able to delete post.");emit __AssertPostCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',1);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',21);
        _;
    }

    modifier required(
            string memory name,
            string memory description,
            string memory url
        ) {emit __FunctionCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',3);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',29);
            emit __AssertPreCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',2);
emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',3);
require(bytes(name).length > 0, "Name field is required");emit __AssertPostCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',2);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',30);
            emit __AssertPreCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',3);
emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',4);
require(bytes(description).length > 0, "Description field is required");emit __AssertPostCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',3);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',31);
            emit __AssertPreCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',4);
emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',5);
require(bytes(url).length > 0, "Url field is required");emit __AssertPostCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',4);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',32);
            _;
        }

    modifier exists(
        uint postIndex
    ) {emit __FunctionCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',4);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',38);
        emit __AssertPreCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',5);
emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',6);
require(PostMapping.contains(post, postIndex) == true, "Post does not exist");emit __AssertPostCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',5);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',39);
        _;
    }

    modifier reachMinimumGoal() {emit __FunctionCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',5);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',43);
        emit __AssertPreCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',6);
emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',7);
require(msg.value >= minGoal, "Minimun goal is not reached, minimun goal is 1000 wei");emit __AssertPostCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',6);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',44);
        _;
    }

    function listPosts() public      returns(string memory data) {emit __FunctionCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',6);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',48);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',8);
data = '[';
emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',49);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',9);
for(uint i = PostMapping.iterate_start(post);
        PostMapping.iterate_valid(post, i);
        i = PostMapping.iterate_next(post, i)) {
emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',52);
            emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',10);
(
                uint key,
                string memory name,
                string memory description,
                string memory url,
                address payable owner
            ) = PostMapping.iterate_get(post, i);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',60);
            emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',11);
bool validAddress = msg.sender == owner || validAddressesWhenPay[msg.sender][i];
emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',61);
            emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',12);
data = string(
                abi.encodePacked(
                    data,
                    Utils.getPostObject(key, name, description, validAddress ? url : ''),
                    (i == post.size) ? '' : ', '
                )
            );
        }
emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',69);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',13);
data = string(abi.encodePacked(data, ']'));
    }

    function savePost(
        string memory name,
        string memory description,
        string memory url
    ) public required(
        name,
        description,
        url
    ) returns (uint) {emit __FunctionCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',7);


emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',82);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',14);
PostMapping.insert(post, name, description, url, msg.sender);
emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',83);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',15);
return post.size;
    }

    function getPost(
        uint postIndex
    ) public      exists(
        postIndex
    ) returns (string memory){emit __FunctionCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',8);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',91);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',16);
(
            uint key,
            string memory name,
            string memory description,
            string memory url,
            address payable owner
        ) = PostMapping.iterate_get(post, postIndex);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',99);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',17);
bool validAddress = msg.sender == owner || validAddressesWhenPay[msg.sender][postIndex];
emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',100);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',18);
return string(
            abi.encodePacked(
                Utils.getPostObject(
                    key,
                    name,
                    description,
                    validAddress ? url : ''
                )
            )
        );
    }

    function payForAccess(uint postIndex) public payable reachMinimumGoal() exists(postIndex) returns (bool) {emit __FunctionCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',9);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',113);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',19);
(
            uint key,
            ,
            ,
            string memory url,
            address payable owner
        ) = PostMapping.iterate_get(post, postIndex);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',121);
        emit __AssertPreCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',7);
emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',20);
require(owner != msg.sender, "You can not donate to yourself!");emit __AssertPostCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',7);


emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',123);
        emit __AssertPreCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',8);
emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',21);
require(validAddressesWhenPay[msg.sender][key] == false, 'You already paid for this file');emit __AssertPostCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',8);


emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',125);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',22);
validAddressesWhenPay[msg.sender][key] = true;

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',127);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',23);
owner.transfer(msg.value);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',129);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',24);
emit ReturnPostFileUrl(string(abi.encodePacked('{"url":', '"', url, '",', '"key" : ', '"', Utils.toString(key), '"}')));
emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',130);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',25);
return true;
    }

    function deletePost(uint postIndex) public isContractOwner() exists(postIndex) returns(bool){emit __FunctionCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',10);

emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',134);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',26);
PostMapping.remove(post, postIndex);
emit __CoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',135);
        emit __StatementCoverageDPostit('/home/pkro/Kingsland/projects/dapp/contracts/DPostit.sol',27);
return true;
    }
}
